import React from 'react';
import styles from '../styles/DestinationsPage.module.css';

function DestinationsPage() {
    return (
        <div className={styles.pageContainer}>
            <header className={styles.hero}>
                <h1>Explore Our Destinations</h1>
                <p>Discover breathtaking places tailored to your interests.</p>
            </header>
            <section className={styles.destinationList}>
                <div className={styles.destination}>
                    <h2>Paris</h2>
                    <p>The city of lights and love.</p>
                </div>
                <div className={styles.destination}>
                    <h2>Bali</h2>
                    <p>Relax on stunning beaches or explore lush jungles.</p>
                </div>
            </section>
        </div>
    );
}

export default DestinationsPage;
